import React from "react";
import { useNavigate } from "react-router-dom";

const HomePage = () => {
  const fixedRoomID = "123456"; // Fixed Room ID
  const navigate = useNavigate();

  const handleJoinRoom = () => {
    // Directly navigate to the room using the fixed ID
    navigate(`/room/${fixedRoomID}`);
  };

  return (
    <div style={styles.wrapper}>
      <img
        src="https://media.istockphoto.com/id/1263326624/vector/video-conferencing-at-home-close-up-african-young-woman-having-video-call-meeting-with.jpg?s=612x612&w=0&k=20&c=bgggESPzhZdCPe42a-AbJWApDetOrQ9ZD7hT4WbZlFo="
        alt="Room Illustration"
        style={styles.image}
      />
      <div style={styles.container}>
        <span style={styles.text}>Join Room</span>
        <button onClick={handleJoinRoom} style={styles.button}>
          Join Room {fixedRoomID}
        </button>
      </div>
    </div>
  );
};

const styles = {
  wrapper: {
    textAlign: "center",
  },
  image: {
    width: "500px",
    marginBottom: "50px",
  },
  container: {
    backgroundColor: "#hjf562",
    padding: "40px",
    borderRadius: "12px",
    boxShadow: "0 8px 15px rgba(0, 0, 0, 0.1)",
    maxWidth: "400px",
    margin: "0 auto",
  },
  text: {
    fontSize: "1.5rem",
    fontWeight: "600",
    color: "#333",
    marginBottom: "10px",
  },
  button: {
    backgroundColor: "#007bff",
    color: "white",
    padding: "10px 20px",
    border: "none",
    borderRadius: "8px",
    cursor: "pointer",
    textTransform: "uppercase",
    transition: "all 0.3s ease",
  },
};

export default HomePage;
